import '../css/App.css';

const Content = ({ items, setItems }) => {
	// console.log(items)
	return (
		<div className="App-content">
			{items.length > 0 && items.map(({
				name,
				type,
				desc,
				race,
			}) => (
				<div>
					<div>{name}</div>
					<div>{type}</div>
					<div>{race}</div>
					<div>{desc}</div>
				</div>
			))}
		</div>
	);
}

export default Content;
